import { useState, useEffect } from "react";

function Favorite(){
    const[favorite, setFavorite] = useState ([]);
    useEffect (()=>{
        const myListFavorite = localStorage.getItem ("PrimeFlix");
        setFavorite(JSON.parse(myListFavorite) || []);
    },[])
    return(
        <div>
            <h1>Meus filmes</h1>



        </div>

    )

}
export default Favorite;
